func resourceDiscoveryEngineWidgetConfigUpdate(d *schema.ResourceData, meta interface{}) error {
	config := meta.(*transport_tpg.Config)
	userAgent, err := tpgresource.GenerateUserAgentString(d, config.UserAgent)
	if err != nil {
		return err
	}

	identity, err := d.Identity()
	if err == nil && identity != nil {
		if locationValue, ok := d.GetOk("location"); ok && locationValue.(string) != "" {
			if err = identity.Set("location", locationValue.(string)); err != nil {
				return fmt.Errorf("Error setting location: %s", err)
			}
		}
		if collectionIdValue, ok := d.GetOk("collection_id"); ok && collectionIdValue.(string) != "" {
			if err = identity.Set("collection_id", collectionIdValue.(string)); err != nil {
				return fmt.Errorf("Error setting collection_id: %s", err)
			}
		}
		if engineIdValue, ok := d.GetOk("engine_id"); ok && engineIdValue.(string) != "" {
			if err = identity.Set("engine_id", engineIdValue.(string)); err != nil {
				return fmt.Errorf("Error setting engine_id: %s", err)
			}
		}
		if widgetConfigIdValue, ok := d.GetOk("widget_config_id"); ok && widgetConfigIdValue.(string) != "" {
			if err = identity.Set("widget_config_id", widgetConfigIdValue.(string)); err != nil {
				return fmt.Errorf("Error setting widget_config_id: %s", err)
			}
		}
		if projectValue, ok := d.GetOk("project"); ok && projectValue.(string) != "" {
			if err = identity.Set("project", projectValue.(string)); err != nil {
				return fmt.Errorf("Error setting project: %s", err)
			}
		}
	} else {
		log.Printf("[DEBUG] (Update) identity not set: %s", err)
	}

	billingProject := ""

	project, err := tpgresource.GetProject(d, config)
	if err != nil {
		return fmt.Errorf("Error fetching project for WidgetConfig: %s", err)
	}
	billingProject = project

	obj := make(map[string]interface{})
	accessSettingsProp, err := expandDiscoveryEngineWidgetConfigAccessSettings(d.Get("access_settings"), d, config)
	if err != nil {
		return err
	} else if v, ok := d.GetOkExists("access_settings"); !tpgresource.IsEmptyValue(reflect.ValueOf(v)) && (ok || !reflect.DeepEqual(v, accessSettingsProp)) {
		obj["accessSettings"] = accessSettingsProp
	}
	uiSettingsProp, err := expandDiscoveryEngineWidgetConfigUiSettings(d.Get("ui_settings"), d, config)
	if err != nil {
		return err
	} else if v, ok := d.GetOkExists("ui_settings"); !tpgresource.IsEmptyValue(reflect.ValueOf(v)) && (ok || !reflect.DeepEqual(v, uiSettingsProp)) {
		obj["uiSettings"] = uiSettingsProp
	}
	uiBrandingProp, err := expandDiscoveryEngineWidgetConfigUiBranding(d.Get("ui_branding"), d, config)
	if err != nil {
		return err
	} else if v, ok := d.GetOkExists("ui_branding"); !tpgresource.IsEmptyValue(reflect.ValueOf(v)) && (ok || !reflect.DeepEqual(v, uiBrandingProp)) {
		obj["uiBranding"] = uiBrandingProp
	}
	homepageSettingProp, err := expandDiscoveryEngineWidgetConfigHomepageSetting(d.Get("homepage_setting"), d, config)
	if err != nil {
		return err
	} else if v, ok := d.GetOkExists("homepage_setting"); !tpgresource.IsEmptyValue(reflect.ValueOf(v)) && (ok || !reflect.DeepEqual(v, homepageSettingProp)) {
		obj["homepageSetting"] = homepageSettingProp
	}

	url, err := tpgresource.ReplaceVars(d, config, "{{DiscoveryEngineBasePath}}projects/{{project}}/locations/{{location}}/collections/{{collection_id}}/engines/{{engine_id}}/widgetConfigs/{{widget_config_id}}")
	if err != nil {
		return err
	}

	log.Printf("[DEBUG] Updating WidgetConfig %q: %#v", d.Id(), obj)
	headers := make(http.Header)
	updateMask := []string{}

	if d.HasChange("access_settings") {
		updateMask = append(updateMask, "accessSettings")
	}

	if d.HasChange("ui_settings") {
		updateMask = append(updateMask, "uiSettings")
	}

	if d.HasChange("ui_branding") {
		updateMask = append(updateMask, "uiBranding")
	}

	if d.HasChange("homepage_setting") {
		updateMask = append(updateMask, "homepageSetting")
	}
	// updateMask is a URL parameter but not present in the schema, so ReplaceVars
	// won't set it
	url, err = transport_tpg.AddQueryParams(url, map[string]string{"updateMask": strings.Join(updateMask, ",")})
	if err != nil {
		return err
	}

	// err == nil indicates that the billing_project value was found
	if bp, err := tpgresource.GetBillingProject(d, config); err == nil {
		billingProject = bp
	}

	// if updateMask is empty we are not updating anything so skip the post
	if len(updateMask) > 0 {
		res, err := transport_tpg.SendRequest(transport_tpg.SendRequestOptions{
			Config:    config,
			Method:    "PATCH",
			Project:   billingProject,
			RawURL:    url,
			UserAgent: userAgent,
			Body:      obj,
			Timeout:   d.Timeout(schema.TimeoutUpdate),
			Headers:   headers,
		})

		if err != nil {
			return fmt.Errorf("Error updating WidgetConfig %q: %s", d.Id(), err)
		} else {
			log.Printf("[DEBUG] Finished updating WidgetConfig %q: %#v", d.Id(), res)
		}

	}

	return resourceDiscoveryEngineWidgetConfigRead(d, meta)
}

